import { AppBar, Toolbar,styled } from '@mui/material';


// components 
import LoginDialog from "./account/LoginDialog";


const Header = styled(AppBar)`
    height: 125px;
    
`
const Messenger = () => {
    return (
        <>
            <Header>
                <Toolbar>

                </Toolbar>
            </Header>

            <LoginDialog />

        </>


    )
}

export default Messenger;
